import * as Bidi from 'webdriver-bidi-protocol/out/gen/main';
import * as BidiPermissions from 'webdriver-bidi-protocol/out/gen/permissions';
import * as BidiBluetooth from 'webdriver-bidi-protocol/out/gen/web-bluetooth';
import * as BidiUaClientHints from 'webdriver-bidi-protocol/out/gen/ua-client-hints';
export * from 'webdriver-bidi-protocol/out/gen/main';
export * from 'webdriver-bidi-protocol/out/gen/permissions';
export * from 'webdriver-bidi-protocol/out/gen/web-bluetooth';
export {UserAgentClientHintsCommand} from 'webdriver-bidi-protocol/out/gen/ua-client-hints';
export {BidiUaClientHints};
export * from 'webdriver-bidi-protocol/out/gen/mapping';
type ExternalSpecCommand<T> = {
  id: Bidi.JsUint;
} & T;
export type Result = Bidi.ResultData;
export type Command =
  | Bidi.Command
  | ExternalSpecCommand<BidiPermissions.PermissionsCommand>
  | ExternalSpecCommand<BidiBluetooth.BluetoothCommand>
  | ExternalSpecCommand<BidiUaClientHints.UserAgentClientHintsCommand>;
type ExternalSpecEvent<T> = {
  type: 'event';
} & T &
  Bidi.Extensible;
export type Event =
  | Bidi.Event
  | ExternalSpecEvent<BidiBluetooth.BluetoothEvent>;
